import React from "react";
import Navb from "./components/navbar";
import Hero from "./components/hero";
import ProductsGrid from "./components/products";

const Home = () => {
  return (
    <>
      <Navb />
      <Hero />
      <ProductsGrid />
    </>
  );
};

export default Home;
